The word '''key space''' (or '''keyspace''') is used in
* [[Key space (cryptography)]] for an algorithm refers to the set of all possible keys that can be used to initialize it, * [[Keyspace (data store)]], an open source, replicated, persistent key-value datastore written in C++, * [[Keyspace (distributed data store)]], an object in [[NoSQL (concept)|NoSQL]] [[data store]]s that can be seen as a [[Schema (database)|schema]] in [[RDBMS]] [[database]]s.
